INSERT INTO `sys_material` VALUES (1, 1001, '知识图谱', '{\"nodes\":[{\"id\":\"root\",\"name\":\"Java SE核心\",\"category\":0},{\"id\":\"base\",\"name\":\"基础语法\",\"category\":1},{\"id\":\"oop\",\"name\":\"面向对象\",\"category\":1},{\"id\":\"coll\",\"name\":\"集合框架\",\"category\":1},{\"id\":\"io\",\"name\":\"IO流\",\"category\":1},{\"id\":\"var\",\"name\":\"变量与数据类型\",\"category\":2},{\"id\":\"flow\",\"name\":\"流程控制\",\"category\":2},{\"id\":\"cls\",\"name\":\"类与对象\",\"category\":2},{\"id\":\"inh\",\"name\":\"继承与多态\",\"category\":2},{\"id\":\"list\",\"name\":\"ArrayList\",\"category\":2},{\"id\":\"map\",\"name\":\"HashMap\",\"category\":2}],\"links\":[{\"source\":\"root\",\"target\":\"base\"},{\"source\":\"root\",\"target\":\"oop\"},{\"source\":\"root\",\"target\":\"coll\"},{\"source\":\"root\",\"target\":\"io\"},{\"source\":\"base\",\"target\":\"var\"},{\"source\":\"base\",\"target\":\"flow\"},{\"source\":\"oop\",\"target\":\"cls\"},{\"source\":\"oop\",\"target\":\"inh\"},{\"source\":\"coll\",\"target\":\"list\"},{\"source\":\"coll\",\"target\":\"map\"}]}', 'Java知识体系图谱.json', '', '2025-12-10 08:56:12');
INSERT INTO `sys_material` VALUES (2, 1001, '目录', '[{\"id\":1,\"label\":\"第一章：Java语言概述\",\"level\":1,\"index\":1,\"children\":[{\"id\":11,\"label\":\"1.1 Java历史与特性\",\"level\":2},{\"id\":12,\"label\":\"1.2 JDK安装与环境配置\",\"level\":2},{\"id\":13,\"label\":\"1.3 第一个Java程序\",\"level\":2}]},{\"id\":2,\"label\":\"第二章：基本语法\",\"level\":1,\"index\":2,\"children\":[{\"id\":21,\"label\":\"2.1 关键字与标识符\",\"level\":2},{\"id\":22,\"label\":\"2.2 基本数据类型\",\"level\":2},{\"id\":23,\"label\":\"2.3 运算符与表达式\",\"level\":2}]},{\"id\":3,\"label\":\"第三章：面向对象编程(上)\",\"level\":1,\"index\":3,\"children\":[{\"id\":31,\"label\":\"3.1 类与对象\",\"level\":2},{\"id\":32,\"label\":\"3.2 方法定义与调用\",\"level\":2},{\"id\":33,\"label\":\"3.3 构造器\",\"level\":2}]}]', '教学大纲.json', '', '2025-12-10 08:56:12');
INSERT INTO `sys_material` VALUES (3, 1001, '测验', '{\"deadline\":\"2025-12-31 23:59:59\",\"questions\":[{\"title\":\"Java中int数据类型占用多少个字节？\",\"options\":[\"2个字节\",\"4个字节\",\"8个字节\",\"1个字节\"],\"answer\":1,\"score\":20},{\"title\":\"下列哪个关键字用于定义继承关系？\",\"options\":[\"implements\",\"extends\",\"import\",\"package\"],\"answer\":1,\"score\":20},{\"title\":\"main方法的正确声明格式是？\",\"options\":[\"public void main(String[] args)\",\"public static void main(String args)\",\"public static void main(String[] args)\",\"static public void main()\"],\"answer\":2,\"score\":20},{\"title\":\"Java中所有类的父类是？\",\"options\":[\"Class\",\"Object\",\"String\",\"System\"],\"answer\":1,\"score\":20},{\"title\":\"ArrayList的底层数据结构是？\",\"options\":[\"链表\",\"数组\",\"哈希表\",\"树\"],\"answer\":1,\"score\":20}]}', '第一阶段基础自测', '', '2025-12-10 08:56:12');
INSERT INTO `sys_material` VALUES (4, 1001, '作业', '{\"text\":\"请设计一个简单的“学生成绩管理系统”控制台程序。\n\n功能要求：\n1. 定义Student类（包含学号、姓名、3门课成绩）。\n2. 支持录入学生信息。\n3. 支持查询所有学生信息。\n4. 支持按总分排序显示。\n\n提交格式：请打包源码文件（.java）提交，附件大小不超过10MB。\",\"deadline\":\"2025-06-30 18:00:00\"}', '面向对象综合练习', '', '2025-12-10 08:56:12');
INSERT INTO `sys_material` VALUES (5, 1001, '教材', '{\"name\":\"Java核心技术(卷I)\",\"isbn\":\"978-7-111-54742-6\",\"author\":\"Cay S. Horstmann\",\"publisher\":\"机械工业出版社\",\"edition\":\"第10版\",\"intro\":\"Java领域的圣经级教程，详细讲解了Java SE的基础知识和核心特性。\",\"url\":\"https://book.douban.com/subject/26880667/\"}', '推荐教材：Core Java', '', '2025-12-10 08:56:12');
INSERT INTO `sys_material` VALUES (6, 2002, '知识图谱', '{\"nodes\":[{\"id\":\"root\",\"name\":\"深度学习\",\"category\":0},{\"id\":\"nn\",\"name\":\"神经网络\",\"category\":1},{\"id\":\"cnn\",\"name\":\"CNN\",\"category\":1},{\"id\":\"rnn\",\"name\":\"RNN\",\"category\":1},{\"id\":\"bp\",\"name\":\"反向传播\",\"category\":2},{\"id\":\"act\",\"name\":\"激活函数\",\"category\":2},{\"id\":\"conv\",\"name\":\"卷积层\",\"category\":2},{\"id\":\"pool\",\"name\":\"池化层\",\"category\":2},{\"id\":\"lstm\",\"name\":\"LSTM\",\"category\":2}],\"links\":[{\"source\":\"root\",\"target\":\"nn\"},{\"source\":\"root\",\"target\":\"cnn\"},{\"source\":\"root\",\"target\":\"rnn\"},{\"source\":\"nn\",\"target\":\"bp\"},{\"source\":\"nn\",\"target\":\"act\"},{\"source\":\"cnn\",\"target\":\"conv\"},{\"source\":\"cnn\",\"target\":\"pool\"},{\"source\":\"rnn\",\"target\":\"lstm\"}]}', 'DL知识架构.json', '', '2025-12-10 08:56:12');
