INSERT INTO `sys_quiz_record` VALUES (1, 26, 7, 0, '[0,0,0]', '2025-12-10 09:28:04', '### 学生答题情况分析\n\n**学生答案索引**：`[0,0,0]`  \n**对应选项**：  \n1. 第一题：选择 `Sigmoid`  \n2. 第二题：选择 `降低特征图维度`  \n3. 第三题：选择 `Sigmoid`  \n\n**得分情况**：0/100（全部错误）\n\n---\n\n### 错题解析\n\n#### 1. 第一题：下列哪个函数通常用于多分类问题的输出层？\n- **学生答案**：Sigmoid ❌  \n- **正确答案**：Softmax ✅  \n- **解析**：  \n  - **Sigmoid** 函数通常用于**二分类**问题的输出层，将输出映射到 (0,1) 区间，表示概率。  \n  - **Softmax** 函数适用于**多分类**问题，它将多个神经元的输出转化为概率分布（所有类别概率之和为1），因此是多分类输出层的标准选择。  \n  - ReLU 和 Tanh 主要用于隐藏层的激活函数，不直接用于多分类输出层。\n\n#### 2. 第二题：CNN中池化层的主要作用不包括？\n- **学生答案**：降低特征图维度 ❌  \n- **正确答案**：增加非线性 ✅  \n- **解析**：  \n  - 池化层（如最大池化、平均池化）的主要作用包括：  \n    1. **降低特征图维度**（减少计算量）  \n    2. **减少参数数量**（防止过拟合）  \n    3. **增强平移不变性**（防止过拟合）  \n  - **增加非线性**通常由激活函数（如ReLU）实现，不是池化层的作用。因此，“增加非线性”是本题的正确答案（即“不包括”的作用）。\n\n#### 3. 第三题：解决梯度消失问题的有效激活函数是？\n- **学生答案**：Sigmoid ❌  \n- **正确答案**：ReLU ✅  \n- **解析**：  \n  - **梯度消失问题**常见于深层神经网络，当梯度反向传播时，如果激活函数的导数过小（如 Sigmoid、Tanh），梯度会逐层衰减，导致训练困难。  \n  - **ReLU（Rectified Linear Unit）** 在正区间导数为1，能有效缓解梯度消失，加速深层网络的训练。  \n  - Sigmoid 和 Tanh 的导数在输入较大或较小时会趋近于0，容易导致梯度消失。\n\n---\n\n### 学习建议\n1. **区分激活函数的应用场景**：  \n   - 输出层：二分类用 Sigmoid，多分类用 Softmax。  \n   - 隐藏层：常用 ReLU 及其变体（如 Leaky ReLU）以避免梯度问题。  \n2. **理解CNN各层的作用**：  \n   - 池化层用于降维和防止过拟合，而非引入非线性。  \n   - 非线性由激活函数实现，是网络拟合复杂模式的关键。  \n3. **关注梯度问题的解决方案**：  \n   - 梯度消失/爆炸是训练深层网络的常见挑战，可通过选择 ReLU、批量归一化、残差连接等方法缓解。\n\n如果需要进一步解释或示例，请随时提问！');
